import React, { useState, useEffect } from "react";
import SupportDataService from '../../services/SupportInvServices'
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import Typography from '@material-ui/core/Typography';

const ModalProfil = props => {

    const [listeSupports, setListeSupports] = useState([])

    useEffect(() => {
        getListeSupport()
    }, [])

    const getListeSupport = () => {
        SupportDataService.getByPropositionId(41)
            .then(response => {
                setListeSupports(response.data)
                console.log(response.data)
            })
            .catch(e => {
                console.log(e)
            })
    }

    return (

        <div>
            <div>
                Vos réponses permettent de déterminer que vous pouvez opter pour un niveau de risque
        </div>
            {listeSupports.map((s, key) => {
                // console.log(profil)
                return (
                    <Card key={key} className={classes.root}>
                        <CardContent>
                            <Typography className={classes.title} color="textSecondary" gutterBottom>
                                {s.libelle}
                            </Typography>

                            <Typography variant="body2" component="p">
                                {s.description}
                                <br />

                            </Typography>
                        </CardContent>
                    </Card>
                )
            })}

        </div>
    );
};

export default ModalProfil;
